import React from "react";
import Head from "next/head";
import Link from "next/link";

export default function Home() {
  return (
    <>
      <h1>Home</h1>
      <Head>
        <title>Homepage in Next</title>
      </Head>
      <Link href="about">
        <a>Sobre</a>
      </Link>
    </>
  );
}
